import { useEffect, useState } from 'react';
import { useFormik } from 'formik';
import "./Login.css"
import { basicSchema } from '../../schemas';

const onSubmit = () => {
    console.log()
}

function Login(){
    const {values, handleBlur, handleChange, handleSubmit} = useFormik({
      initialValues:{
        userEmail: '',
        userPassword: '',
    },   
    validationSchema:basicSchema,  
    onSubmit,
 });



 return(

        <div className='cadastro'>

       <div className="tab-container"> 

        <div className="login-usuario">
        <img className= "image" src="https://www.vittude.com/static/images/psico-orange.svg" alt=""></img>
        <span className="active">Psic√≥logo</span>
        </div>

       <div className="login-usuario">
       <img className= "image" src="https://www.vittude.com/static/images/paciente-terracota.svg" alt=""></img>
       <span className="active">Paciente</span>
       </div>

       </div>
        <form onSubmit={handleSubmit} className="form" action="/login" method="POST">

            <div className="formField">
                <label htmlFor="userEmail">Seu email</label>
                <input className="input_cadastro" 
                type="email" 
                placeholder="Digite seu email..." 
                name="userEmail" 
                id="userEmail"
                onChange={handleChange}
                value={values.userEmail}
                onBlur={handleBlur} /> 

            </div>
            <div className="formField">
                <label htmlFor="userPassword">Sua senha</label>
                <input className="input_cadastro" 
                type="password" 
                placeholder="Digite sua senha..."
                name="userPassword" 
                id="userPassword"
                onChange={handleChange}
                value={values.userPassword} 
                onBlur={handleBlur} />
            </div>

            <div className="enviar-cadastro">
            <div className="link-login">
                 <a href="/cadastro">Esqueci minha senha</a>
                </div>
                <button className="button" type="submit">Entrar</button>

            </div>

        </form>
    </div>

    )
}

export default Login;
